import "./Home.css";

const Home = () => {
  const [page, setPage] = useState(1);
  const [content, setContent] = useState({});

  const fetchTrending = async () => {
    let data = {};
    axios.get(`/Assets/data.json`).then((res) => {
      data.users.apps.map((item) => {
        if (!item.catagories[0] in content) {
          data[item.catagories[0]] = [];
        }
        data[item.catagories[0]].push(item);
      });
    });
    console.log(data);

    setContent(data);
  };

  useEffect(() => {
    window.scroll(0, 0);
    fetchTrending();
